import React from 'react';
import './App.scss';

import Sidebar from './components/Sidebar/Sidebar';
import Panel from './components/Panel/Panel';

const App: React.FC = () => {
  return (
    <div className="app">
      <Sidebar />
      <Panel style={{backgroundColor: 'red'}}/>
    </div>
  );
}

export default App;
